import React from "react";
import { Container, Row, Col } from "react-bootstrap";

import SocialMediaCards from "./SocialMediaCards";
import ContactForm from "./ContactForm";

function ContactPage() {
  return (
    <>
    <Container>
      <Row>
        <Col></Col>
        <Col></Col>
      </Row>
    </Container>
      <SocialMediaCards />
      <hr />
      <ContactForm />
    </>
  );
}

export default ContactPage;
